import React, { Component } from 'react'
import { Route } from 'react-router-dom'

const PrivateRoute = ({ component: Component, ...rest }) => (
  <Route {...rest} render={(props) => (
    this.props.authenticated === true
      ? <Component {...props} />
      : <Redirect to='/' />
  )} />
)

export default PrivateRoute
